import React from 'react';
import './App.css';
import Story from './components/Story';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    const fetchStories = async () => {
      const list = await fetch("https://sv-reqres.now.sh/api/listings");
      const stories = await list.json();
      console.log(stories.data);
    }
    fetchStories();
  }


  render() {
    return(
    <div classNme="wrapper">
      {fetchStories().map(story => (
        <Story title={story.title} story={story.description} url={story.weburl}/>
      ))}
    </div>
    )}
}

export default App;
